namespace Mutagen.Bethesda.Oblivion.Internals
{
    public partial class RankBinaryWriteTranslation : IBinaryWriteTranslator
    {
        public readonly static RankBinaryWriteTranslation Instance = new RankBinaryWriteTranslation();

        public static void WriteRecordTypes(
            IRankGetter item,
            MutagenWriter writer,
            RecordTypeConverter? recordTypeConverter,
            MasterReferenceReader masterReferences)
        {
            Mutagen.Bethesda.Binary.Int32BinaryTranslation.Instance.WriteNullable(
                writer: writer,
                item: item.RankNumber,
                header: recordTypeConverter.ConvertToCustom(Rank_Registration.RNAM_HEADER));
            if (item.Name.TryGet(out var Nameitem))
            {
                if (Nameitem.Male.TryGet(out var male))
                {
                    using (HeaderExport.ExportSubRecordHeader(writer, recordTypeConverter.ConvertToCustom(Rank_Registration.MNAM_HEADER)))
                    {
                        Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.WriteNullable(
                            writer: writer,
                            item: male,
                            binaryType: StringBinaryType.NullTerminate);
                    }
                }
                if (Nameitem.Female.TryGet(out var female))
                {
                    using (HeaderExport.ExportSubRecordHeader(writer, recordTypeConverter.ConvertToCustom(Rank_Registration.FNAM_HEADER)))
                    {
                        Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.WriteNullable(
                            writer: writer,
                            item: female,
                            binaryType: StringBinaryType.NullTerminate);
                    }
                }
            }
            Mutagen.Bethesda.Binary.StringBinaryTranslation.Instance.WriteNullable(
                writer: writer,
                item: item.Insignia,
                header: recordTypeConverter.ConvertToCustom(Rank_Registration.INAM_HEADER),
                binaryType: StringBinaryType.NullTerminate);
        }

        public void Write(
            MutagenWriter writer,
            IRankGetter item,
            MasterReferenceReader masterReferences,
            RecordTypeConverter? recordTypeConverter)
        {
            WriteRecordTypes(
                item: item,
                writer: writer,
                recordTypeConverter: recordTypeConverter,
                masterReferences: masterReferences);
        }

        public void Write(
            MutagenWriter writer,
            object item,
            MasterReferenceReader masterReferences,
            RecordTypeConverter? recordTypeConverter)
        {
            Write(
                item: (IRankGetter)item,
                masterReferences: masterReferences,
                writer: writer,
                recordTypeConverter: recordTypeConverter);
        }

    }

